css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("startpage.com") {
    html, body{
        line-height: 1.4em;
        background: #fdfdfd;
    }
    

    
    
    #main_link img{
        display: none;
    }
    #main_link{
        width: 150px;
        height: 150px;
    background-image: url("data:image/png;base64,");    
        background-size: contain;
        background-repeat: no-repeat;
        background-position: center center;
    }
    form#search_form {
        padding-left: 0;
        margin-top: 30px;
    }
    #content ~ #footer {
        display: none;
    }
    
    
    
    
    
    
    #results_count_p, .proxy, #enhanced, #detail, .bookmark, #sponsored, .date_promo, #links, #caption, #news_message_content{
        display:none !important;
    }
    #head{
        background: #666;
        margin: 0;
        padding: 10px;
        min-height: 33px;
    }
    #head > table:first-child{
        display: none;
    }
    #head_left,  #settings{
        padding-top: 5px;
    }
    #head_left a, #category a, #head_left a.active, #category a.active, #settings a, a#xsearch, #xsearch ~ a {
        background: WhiteSmoke;
        padding: 7px 12px 5px;
        border-radius: 0px;
        border-bottom: 2px solid WhiteSmoke;
        color: #666;
        font-weight: normal;
    }
    #head_left a.active, #category a.active{
        border-bottom: 3px solid LightSkyBlue;
        color: SteelBlue;
    }
    #category, #settings{
        display: inline-block;
    }
    
    
    
    
    
    #logo a img{
        display: none;
    }
    #logo{
    background-image: url("data:image/png;base64,");    
    opacity: 0.4;
    width: 150px;
	height: 150px;
	background-size: contain;
	background-repeat: no-repeat;
	background-position: center center;
    margin: 65px 40px;
    }
    #show_hide{display:none;}
    #side_bar {
    margin-top: 60px !important;
    width:230px;
    }
    
    
    
    
    #results, #search, #tod_wrap{
        margin-left:229px;
    }
    .tod{
        color:#aaa !important;
    }
    #tod_wrap{
        color:#999;
        font-family: "Georgia";
        font-style: italic;
        margin-top: 10px;
    }
    #tod_wrap a{
        color:#666;
    }
    #tod_wrap a:hover{
        text-decoration: none;
    }
    
    #results_header > form {
        margin-top: 20px;
    }
    input#query_top, input#query_bottom, input#query {
        width: 600px;
        border-radius: 0px;
        height: 30px;
        padding:5px 10px;
        color:#666;
        border: 2px solid SkyBlue;
        box-shadow: none;
    }
    td#input_p:after, form>p:after {
        content: "";
        width:26px;
        height: 26px;
        background-image: url("data:image/png;base64,");
        background-size: contain;
	background-repeat: no-repeat;
	background-position: center center;
        display: inline-block;
        position: relative;
        right: 40px;
        top: 5px;
        opacity: 0.2;
    }
    input#submit1 {
    margin: 0 0 0 -100px;
    opacity: 0;
    overflow: hidden;
    width: 35px;
    }
    input#submit  {
    margin: 0 0 0 -35px;
    opacity: 0;
    overflow: hidden;
    width: 35px;
    }
    
    
    
    
    
    
    
    #results_content{
        background: transparent;
    }
    
    #results>div{
       display:none;
    }
    #results ol {
        padding-top: 20px;
    }
    #results p {
        font-size: 15px;
        line-height: 1.4em;
        width: 1200px;
    }
    .result .desc{
        color: #666;
    }
    .result p>b{
        color:#777 !important;
    }
   .result p:nth-child(3){ 
        color:#fff;   
    }
    .result h3 a {
        color: SteelBlue !important;
        text-shadow: 0 2px 0 #FFFFFF;
    }
    .result h3 a:hover {
        color: DodgerBlue !important;
    }
    
    
    
    
    
    
    
    a.numbers_st {
        background: LightSteelBlue;
        border-radius: 6px;
        color: #FFFFFF;
        margin: 0 3px 0 3px;
        padding: 5px 10px;
        text-decoration: none;
    }
        a.numbers_st:hover {
        color: #FFFFFF;
        background: SteelBlue;
    }
    #jumpsbar{
        color: SteelBlue;
    }
    
    
    
    
    
    
    
    
    
    #imageRow_1 img, #imageRow_2 img, #imageRow_3 img, #imageRow_4 img, #imageRow_5 img, #imageRow_6 img {
        width: 150px; height: auto;
    }
}
